import React from 'react'

export default function StartScreen() {
    return (
        <div className='start'>
            <h2>Welcome to the React Quiz!</h2>
            <h3>X questions to test your mastery</h3>
            <button className='btn'>Let's Start</button>
        </div>
    )
}
